#include <unordered_map>
#include <unordered_set>
#include <vector>
#define ll long long
const int N = 5e3 + 4;
const int MOD = 1e9 + 7;

using namespace std;

int solve() {
  // Your solution logic here
  int n, k;
  cin >> n >> k;

  // Array of +ve integers
  vector<int> a(n); 

  for (int i = 0; i < n; i++) {
    cin >> a[i];
  }

  int INF = n + 2;
  vector<int> dp(k + 1, INF); // dp[i] = smallest subset with sum = i

  dp[0] = 0; // Empty subset

  for (int i = 0; i < n; i++) {
    // starting from k - a[i] as we add a[i] to each subset
    for (int j = k - a[i]; j >= 0; j--) {
      if (dp[j] != INF) {
        dp[j + a[i]] = min(dp[j + a[i]], dp[j] + 1); // try adding a[i] in a subset with sum j 
      }
    }
  }

  if (dp[k] == INF) {
    cout << "Answer doesn't exist" << endl;
  } else {
    cout << dp[k] << endl;
  }

  return 0;
}

int main() {
  int t = 1;
  cin >> t;

  while (t--) {
    solve();
  }

  return 0;
}
